import React, { useState } from 'react';
import { sendTrade } from './';

const OrderForm: React.FC<{ asset: string }> = ({ asset }) => {
  const [quantity, setQuantity] = useState<number | string>('');
  const [price, setPrice] = useState<number | string>('');
  const [orderType, setOrderType] = useState<'LIMIT' | 'MARKET'>('LIMIT');
  const [message, setMessage] = useState<string>('');

  const handleOrderSubmit = async (side: 'BUY' | 'SELL') => {
    const order = {
      asset,
      side,
      type: orderType,
      quantity: typeof quantity === 'string' ? parseFloat(quantity) : quantity,
      price: orderType === 'LIMIT' ? (typeof price === 'string' ? parseFloat(price) : price) : undefined,
      notional: (typeof quantity === 'string' ? parseFloat(quantity) : quantity) * (typeof price === 'string' ? parseFloat(price) : price),
    };

    const response = await sendTrade(order);
    if (response && !response.error) {
      setMessage(`Order ${side} successfully placed with id: ${response.id}`);
    } else {
      setMessage(`Order submission failed: ${response.error || 'Unknown error'}`);
    }
  };

  return (
    <div className="order-form">
      <div>
        <label>Quantity: </label>
        <input
          type="number"
          value={quantity}
          onChange={(e) => setQuantity(e.target.value)}
        />
      </div>
      {orderType === 'LIMIT' && (
        <div>
          <label>Price: </label>
          <input
            type="number"
            value={price}
            onChange={(e) => setPrice(e.target.value)}
          />
        </div>
      )}
      <div>
        <button onClick={() => handleOrderSubmit('BUY')}>Place Buy Order</button>
        <button onClick={() => handleOrderSubmit('SELL')}>Place Sell Order</button>
      </div>
      {message && <p>{message}</p>}
    </div>
  );
};

export default OrderForm;
